Director: Nic Cramer
Studio: Private

Deep inside enemy territory, the mysterious Colonel Flurtz (Melissa Hill) and her fanatic renegade troops run amok sexually. They are scoring victory after victory! This action packed journey lettered with luscious KGB spies, Viet Cong nymphs and insatiable allies. It's all there just for you!

Cast
Tammi Ann, Laura Palmer, Anita Blond, Nicolette Fauludi, Agnes Tilli, Linda Moore, Barbara Molat
